import React from 'react'
import Navbar from '../Components/Navbar/Navbar'
import styled from 'styled-components';


const Container = styled.div`
    display:flex;
    flex-direction: column;
    padding: 10px;

`

const Processors = styled.select`
  margin: 10px;
  padding: 5px;
  cursor: pointer;
  width: 10vw;
  border-radius: 10px;

  &:hover {
    background-color: lightgray;
  }
`;

const ProcessorOptions = styled.option``;

const Ram = styled.select`
margin: 10px;
padding: 5px;
cursor: pointer;
width: 10vw;
border-radius: 10px;

&:hover {
  background-color: lightgray;
}
`
const RamOptions = styled.option``

const ImageContainer = styled.div`
    display: flex;
`

const Image = styled.img`
    width: 80vw;
    height: 60vh;
    margin: 1%; 
    padding-left: 7%;
`
const Title = styled.div`
    font-weight: bold;
    font-size: 50px;
    opacity: 0.7;
    margin-left: 25%;
    padding-bottom: 20px;

`
const MinimumRequirements = styled.div`
    background: lightgray;
    display: flex;
`

const GTA = () => {
  return (
    <div>
        <Navbar />
        <Container>
            <ImageContainer>
            <Image src={require('../images/GTA.png')}></Image>
            </ImageContainer>
            <Title> Best Tuning for Flawless Gameplay of GTA V</Title>
            <Options>
                <ProcessorOptions>Choose Processor</ProcessorOptions>
                <ProcessorOptions>i3</ProcessorOptions>
                <ProcessorOptions>i5</ProcessorOptions>
                <ProcessorOptions>i7</ProcessorOptions>
                <ProcessorOptions>Ryzen 9</ProcessorOptions>

            <Ram>
                <RamOptions>Choose RAM</RamOptions>
                <RamOptions>8GB</RamOptions>
                <RamOptions>16GB</RamOptions>
            </Ram>
        </Options>


        </Container>
    </div>
  )
}

export default GTA
